// 创建表示自环的路径
const selfLoop = container.append("g")
    .selectAll("path")
    .data(selfLoops)
    .join("path")
    .attr("stroke", "#999")
    .attr("stroke-opacity", 0.6)
    .attr("fill", "none")
    .attr("d", d => {
        // 创建一个圆形路径
        const x = d.source.x;
        const y = d.source.y;
        const dx = 15; // 控制自环大小
        const dy = 15; // 控制自环大小
        return `M ${x},${y} m ${-dx},${-dy} a ${dx},${dy} 0 1,0 ${2*dx},0 a ${dx},${dy} 0 1,0 ${-2*dx},0`;
    });
const degrees = nodes.map(d => d.degree);
const maxDegree = Math.max(...degrees);
const minDegree = Math.min(...degrees);
const sizeScale = d3.scaleLinear().domain([minDegree, maxDegree]).range([20, 1200]);

const node = container.append("g")
